import React from 'react'
import { useSelector } from "react-redux";
import {Table} from 'react-bootstrap'
const Worker = () => {
    
    const id = useSelector(state => state.dataw.worker) 
    return (
        <div>
         
                {id._id}
                 {id.fName}
                 {id.phoneNumber}
                 {id.age}
                {id.email}
                
        </div>
    )
}

export default Worker
